import React, { Component } from 'react';
class Contact extends Component {
    render(){
      return (
        <div>
        <h1 id="Title"> Contact Information </h1>
        <div className="ContactStyle">

       <form>
         <label> Dogs Are family </label>
         <br />
         <br />
         <label>Phone <br /> <a href="tel:5418199410">541.819.9410 </a></label>
         <br />
         <br />
         <label>Email <br /> <a href="mailto:homeraisedcairns@gmail.com"> HomeRaisedCairns@gmail.com </a></label>
        <br />
        <br />

       </form>
        </div>
        </div>
      ); 
    }
  }
  export default Contact;
